const Course_Benefits = () => {
  return (
    <section className="padding">
      <h3 className="title-lg text-center">
        <span className="halfbg-right">سود دوره ی آنلاین</span>
      </h3>
      <p className="pagecenter mt-5 text-center">
        دوره ی آنلاین برخلاف دوره های عادی نتیجه ی قابل اطمینان تری داره و آینده
        ی پس از این دوره تضمین شده خواهد بود. چند تا از ویژگی هایی که سبب این
        برتری میشه رو این پایین برات توضیح دادیم:
      </p>
      <div className="grid"></div>
    </section>
  );
};

export default Course_Benefits;
